export const AddNewActionFigureForm = props => {
    const [productLine, setProductLine] = useState();

    const handleProductLineChange = event => {
        setProductLine(event.target.value);
    };

    productLine && console.log(productLine);
    console.log(ALL_ACTION_FIGURE_ATTRIBUTES)

